I figured from the code that for environment ,it gets the artifacts to show on the products dashboard from the artifact table : 
Reference of the code : 
Class DynamicPipelineServiceImpl  
Flow: 
search() -> buildPipeline() -> processDeployments() -> 
```
   		if (env.getUnits() != null) {
    			for (DeployableUnit du : env.getUnits()) {
    				ArtifactIdentifier id = new ArtifactIdentifier(null, du.getName(), du.getVersion(),null, null);
    				
    				Collection<BinaryArtifact> tmp = artifacts.get(id);
    				if (tmp != null && !tmp.isEmpty()) {
    					artifact = tmp.iterator().next();
    					deployableUnit = du;
    					break;
    				}
    			}
    		}
```


here product view gets the artifacts from the artifacts collection and if we are not using any artifacts collector ( my case) then this will be empty.

